REPLACE INTO `contest` (`id`, `Ten`, `Date_begin`, `Date_end`, `Date_result`, `Thele`, `Bantochuc`, `Bangiamkhao`, `Phuongthuc`, `Giaithuong`, `Active`, `created_at`, `updated_at`) VALUES
	(1, 'CUỘC THI CUSC Creative Cup 2020', '2019-10-01', '2019-12-22', '2019-12-27', '<p>- Tác phẩm dự thi sẽ theo từng chủ đề chọn và đúng quy định cụ thể.<br />\r\n- Mỗi sản phẩm dự thi phải đảm bảo có nội dung lành mạnh, phù hợp thuần phong mỹ tục và phải đảm bảo bản quyền tác giả, không sao chép.</p>', '<p>* Trưởng ban tổ chức: thầy Nguyễn Hùng Dũng - Trưởng Bộ môn KTPM&amp;ĐPT</p>', '<p>Những thầy/cô có nhiều kinh nghiệm trong lĩnh vực IT:<br />\r\n&nbsp;+ Thầy Nguyễn Hoàng Việt – Trưởng ban.<br />\r\n&nbsp;+ Thầy Nguyễn Hùng Dũng – Thành viên.<br />\r\n&nbsp;+ Thầy Nguyễn Trung Kiên – Thành viên.<br />\r\n&nbsp;+ Thầy Võ Duy Anh – Thành viên.<br />\r\n&nbsp;+ Đại diện hiệp hội CNTT Cần Thơ – Thành viên.</p>', '<p>• Tác giả điền đơn tham dự và tác phẩm trực tiếp lên trang website theo từng chủ đề.<br />\r\n• Dự thi theo nhóm hoặc cá nhân.<br />\r\n• Ban Tổ chức cuộc thi không tác phẩm gửi với bất kỳ hình thức nào khác (qua: Email, USB, CD...).</p>', '<p>Mỗi Chủ đề sẽ bao gồm:</p>\r\n\r\n<p>• 01 Giải Nhất.</p>\r\n\r\n<p>• 01 Giải Nhì.</p>\r\n\r\n<p>• 01 Giải Ba.</p>\r\n\r\n<p>• 02 Giải Khuyến khích.</p>', 1, '2019-09-23 22:55:25', '2019-09-23 22:55:25'),
	(2, 'CUỘC THI ẢNH LOGISTICS LẦN THỨ II', '2019-09-19', '2019-09-29', '2019-10-10', '<p>• Tham gia cuộc thi đồng nghĩa với việc tác giả chấp thuận những quy định của cuộc thi.<br />\r\n• Không ghi chú thích, chữ ký trên ảnh, ảnh có dấu hiệu nhận dạng tác giả sẽ bị loại trực tiếp mà không phải thông báo.<br />\r\n• Ban Tổ chức cuộc thi được phép sử dụng hình ảnh dự thi để phục vụ cho công tác quảng bá, tuyên truyền liên quan đến cuộc thi mà không phải trả bất kỳ khoản nhuận bút nào khác ngoài nhuận ảnh dự treo (nếu có).<br />\r\n• Ban Tổ chức không chịu trách nhiệm các trường hợp mất mát, thất lạc nếu tác giả không gửi đúng quy định.<br />\r\n• Tác giả có ảnh đoạt giải hoặc trưng bày triển lãm sẽ được yêu cầu gửi file ảnh có dung lượng lớn, phù hợp với việc in ấn và trưng bày triển lãm, tối thiểu 5MB trở lên.<br />\r\n• Tác giả phải chịu trách nhiệm về bản quyền tác phẩm của mình. Ban tổ chức không chịu trách nhiệm về bất cứ tranh chấp nào liên quan tới bản quyền tác phẩm.</p>', '<p>- Trung Tâm Trung tâm Công nghệ phần mềm Đại học Cần Thơ.<br />\r\n- Trung Tâm Đào tạo Lập trình viên Quốc tế Aptech&lt;/p&gt;</p>', '<p>• Thạc sĩ, Nguyễn Hùng Dũng - Trưởng Bộ môn, Trung tâm Công nghệ phần mềm ĐHCT.<br />\r\n• Tiến sĩ, Lưu Tiến Đạo - Phó Bộ phận đào tạo, Trung tâm Công nghệ phần mềm ĐHCT.</p>', '<p>• Tác giả điền đơn tham dự và gửi ảnh trực tiếp lên trang website: https://arena.cusc.vn<br />\r\n• Ban Tổ chức cuộc thi không nhận ảnh gửi với bất kỳ hình thức nào khác (qua: Email, USB, CD...).<br />\r\n* Ảnh được giải được tính theo tiêu chuẩn điểm cấp tỉnh của Hội Nghệ sĩ Nhiếp ảnh Việt Nam.</p>', '<p>01 Giải Nhất:2,000 USD/ giải.</p>\r\n\r\n<p>02 Giải Nhì: 1000 USD/ giải.</p>\r\n\r\n<p>02 Giải Ba: 800 USD/ giải.</p>\r\n\r\n<p>02 Giải Ấn tượng (*): 700 USD/ giải.</p>\r\n\r\n<p>05 Giải Khuyến khích: 500 USD/ giải</p>', 0, '2019-09-23 22:55:25', '2019-09-23 22:55:25');
