REPLACE INTO `theloai` (`id`, `Ten`, `Ten_chude`, `Thele_pdf`, `Banner`, `Mucdich`, `Doituong`, `Noidung`, `Thele`, `Thele_tomtat`, `Quydinh`, `Tieuchi`, `Giaithuong`, `Giaithuong_tomtat`, `Quycach`, `Phuongthuc`, `Bantochuc`, `Bangiamkhao`, `created_at`, `updated_at`, `id_contest`) VALUES
	(1, 'Web App Challenge', 'Web App Challenge', 'Web_App_Challenge.pdf', NULL, '<p>- Tạo sân chơi cho các sinh viên CUSC yêu thích lập trình và cũng là dịp để CUSC tìm ra nhóm sinh viên Lập trình viên xuất sắc;<br />\r\n- Cuộc thi còn là dịp để sinh viên vận dụng kiến thức chuyên môn vào sản xuất một sản phẩm phần mềm thực tế có tính sáng tạo và vận dụng được vào thực tiễn đời sống;<br />\r\n- Nhằm chọn lọc được các sản phẩm tốt, những ý tưởng thiết kế phần mềm hay để tham gia các cuộc thi trong và ngoài nước.</p>', '<p>- Sinh viên đã và đang học tập tại CUSC.<br />\r\n- Sinh viên có thể dự thi theo nhóm hoặc cá nhân.</p>', '<p>- Cuộc thi dành cho các sinh viên yêu thích lập trình với chủ đề: "Web App Challenge".<br />\r\n- Ứng dụng CNTT vào cuộc sống thực tiễn như: học tập, giảng dạy, giải trí, thương mại…<br />\r\n- Liên quan đến những vấn đề thời sự của ngành công nghệ thông tin, an toàn thực phẩm, bảo vệ môi trường, đô thị thông minh, nông nghiệp thông minh,…</p>', '<p>Có 2 loại sản phẩm dự thi là front-end web và back-end web. Sinh viên có thể sử dụng bất kỳ công nghệ, nền tảng nào để xây dựng sản phẩm. Ví dụ:<br />\r\n- Front-end web:<br />\r\n&nbsp;+ HTML5, CSS3, Javascript, AngularJS, ...<br />\r\n&nbsp;+ Framework: Bootstrap, jQuery, VueJS, ...<br />\r\n- Back-end web<br />\r\n&nbsp;+ Ứng dụng web với Java: Servlet, JSP, Spring, ...<br />\r\n&nbsp;+Ứng dụng web với .Net: ASP.Net, ASP.Net MVC, ...<br />\r\n&nbsp;+ Ứng dụng web với PHP: PHP, PHP Laravel framework, ...</p>', '<p>Có 2 loại sản phẩm dự thi là front-end web và back-end web. Sinh viên có thể sử dụng bất kỳ công nghệ, nền tảng nào để xây dựng sản phẩm.</p>', '<p>- Tham gia cuộc thi đồng nghĩa với việc tác giả chấp thuận những quy định của cuộc thi.<br />\r\n- Ban tổ chức cuộc thi được phép sử dụng các hình ảnh và sản phẩm dự thi để phục vụ cho công tác quảng bá, truyền thông liên quan đến cuộc thi.<br />\r\n- Tác giả phải chịu trách nhiệm về bản quyền sản phẩm của mình. Ban tổ chức không chịu trách nhiệm về bất cứ tranh chấp nào liên quan tới bản quyền sản phẩm.<br />\r\n- Các sản phẩm đã đạt giải nhất, nhì, ba ở bất kỳ cuộc thi nào khác trong và ngoài Trung tâm đều không được tham gia dự thi.<br />\r\n- Sinh viên phải viết thuyết minh và trình bày sản phẩm dự thi cho hội đồng chấm thi.</p>', '<p>- Sản phẩm tham gia dự thi được đánh giá, chấm điểm dựa trên ba tiêu chí chính là <strong>tính hoàn thiện</strong>, <strong>tính công nghệ/ kỹ thuật</strong> và <strong>tính sáng tạo/thẩm mỹ</strong>, tỉ trọng đánh giá cho từng tiêu chí:<br />\r\n&nbsp;+ <u>Tính hoàn thiện</u>: 40%<br />\r\n&nbsp;+ <u>Tính công nghệ/ kỹ thuật</u>: 30%<br />\r\n&nbsp;+ <u>Tính sáng tạo/ thẩm mỹ</u>: 30%</p>', '<p>- Giải cho <em>Front-end</em> web:<br />\r\n&nbsp;o Giải 1: 1.200.000 đồng.<br />\r\n&nbsp;o Giải 2: 900.000 đồng.<br />\r\n&nbsp;o Giải 3: 600.000 đồng.<br />\r\n&nbsp;o 2 giải Khuyến khích, mỗi giải: 300.000 đồng.<br />\r\n- Giải cho <em>Back-end</em> web:<br />\r\n&nbsp;o Giải 1: 1.500.000 đồng.<br />\r\n&nbsp;o Giải 2: 1.000.000 đồng.<br />\r\n&nbsp;o Giải 3: 800.000 đồng.<br />\r\n&nbsp;o 2 giải Khuyến khích, mỗi giải: 300.000 đồng.</p>', '<p><em>Front-end</em> web &amp; <em>Backend</em> web:<br />\r\n&nbsp;o Giải 1: Từ 1.2 - 1.5 triệu VNĐ.<br />\r\n&nbsp;o Giải 2: Từ 900 nghìn - 1 triệu VNĐ.<br />\r\n&nbsp;o Giải 3: Từ 600 - 800 nghìn VNĐ.<br />\r\n&nbsp;o 2 giải Khuyến khích, mỗi giải: 300 nghìn VNĐ.</p>', '<p>* Tài liệu thuyết minh (Biểu mẫu Thuyết minh sản phẩm):<br />\r\n&nbsp;- Tổng quan về hiện trạng của lĩnh vực mà sản phẩm dự thi đang hướng đến.<br />\r\n&nbsp;- Mục tiêu, ý nghĩa và tính cấp thiết của sản phẩm dự thi.<br />\r\n&nbsp;- Khả năng ứng dụng của sản phẩm dự thi.<br />\r\n* Tài liệu và sản phẩm:<br />\r\n&nbsp;- Thiết kế của ứng dụng (giao diện và giải thuật xử lý, đặc biệt là các chức năng về xử lý nghiệp vụ của ứng dụng).<br />\r\n&nbsp;- Mã nguồn website, cơ sở dữ liệu, tài nguyên có liên quan đến website, website đã được biên dịch.</p>', '<p>* Đăng ký dự thi và nộp sản phẩm trực tuyến tại website:<br />\r\n<a href="https://aptech.cusc.vn/webappchallenge2019.html">https://aptech.cusc.vn/webappchallenge2019.html</a></p>', '<p>* Trưởng ban tổ chức: thầy Nguyễn Hùng Dũng - Trưởng Bộ môn KTPM&amp;ĐPT</p>', '<p>* Những thầy/cô có nhiều kinh nghiệm:<br />\r\n&nbsp;1. Thầy <strong>Nguyễn Hoàng Việt</strong> – Trưởng ban.<br />\r\n&nbsp;2. Thầy <strong>Nguyễn Hùng Dũng</strong> – Thành viên.<br />\r\n&nbsp;3. <strong>Đại diện hiệp hội CNTT Cần Thơ</strong> – Thành viên.</p>', '2019-09-23 01:03:39', '2019-09-23 01:03:39', 1),
	(3, 'Be a Super Hero', 'Sáng tạo nhân vật Game – Be a Super Hero', 'TheLe_NhanVatGame_v3.pdf', NULL, '<p>- Nhằm để tạo sân chơi, tạo môi trường học thuật và nghiên cứu trong sinh viên, hướng dẫn sinh viên sáng tạo các sản phẩm thực tế.<br />\r\n- Tạo môi trường rèn luyện kỹ năng sáng tạo và tạo nền tảng để sinh viên tham dự các cuộc thi khác trong và ngoài nước.<br />\r\n- Nằm trong chuỗi các cuộc thi để xét duyệt trao giải <strong>CUSC’s Creative Cup 2020 </strong>của nhánh Mỹ thuật Đa phương tiện.<br />\r\n- Khuyến khích sự đam mê và yêu thích công việc sáng tạo nhân vật trong sinh viên.<br />\r\n- Tiếp cận với quy trình thiết kế nhân vật hiện nay.</p>', '<p>* Sinh viên đang học tập tại CUSC.</p>', '<p>Chủ đề:<strong>&nbsp; “Be a Super Hero</strong>”.</p>\r\n\r\n<p>Thể loại:&nbsp; Mô hình thiết kế: nhân vật siêu anh hùng (Game 3D).</p>', '<p>* Nhân vật: Sinh viên có thể chọn bất kỳ nhân vật nào mà mình yêu thích (nhân vật tưởng tượng, nhân vật trong truyện, nhân vật lịch sử…)</p>\r\n\r\n<p>* Công cụ thể hiện: Các phần mềm dựng mô hình 3D: Autodesk 3Ds Max, Autodesk Maya, Zbrush…</p>', '<p>Nhân vật: Sinh viên có thể chọn bất kỳ nhân vật nào mà mình yêu thích (nhân vật tưởng tượng, nhân vật trong truyện, nhân vật lịch sử…)</p>', '<p>* Sinh viên cần thể hiện bản phác thảo tay nhân vật, và nhân vật render (kết xuất).<br />\r\n&nbsp;+ Bài dự thi cần được đặt tên và mô tả cho nhân vật của mình (không quá 300 từ).<br />\r\n&nbsp;+ Tác phẩm gửi cho BTC là các tập tin ảnh *.jpg hoặc *.pdf với khổ giấy A4 (2480 x 3508 px), độ phân giải từ 150 – 300 dpi.<br />\r\n&nbsp;+ Tác phẩm dự thi chưa tham gia cuộc thi khác.<br />\r\n&nbsp;+ Mỗi sản phẩm dự thi khi nộp cho BTC phải đảm bảo có nội dung lành mạnh, phù hợp thuần phong mỹ tục và phải đảm bảo bản quyền tác giả, không sao chép.<br />\r\n&nbsp;+ Sinh viên phải nộp các nội dung kèm theo mô tả về sản phẩm của mình đáp ứng yêu cầu của BTC cuộc thi.<br />\r\n&nbsp;+ Mỗi nhóm dự thi phải hoàn thành việc báo cáo sản phẩm của nhóm mình. Nếu không sẽ không công nhận kết quả dự thi của nhóm đó.<br />\r\n* Trung tâm được quyền sử dụng kết quả của sản phẩm dự thi cho các hoạt động của Trung tâm.</p>', '<p>* Sản phẩm tham gia dự thi được đánh giá, chấm điểm dựa trên 4 tiêu chí: <strong>Sự sáng tạo</strong>, <strong>Kỹ thuật (công nghệ)</strong>, <strong>Nghệ thuật (thẩm mỹ)</strong> và <strong>tính Hoàn thiện</strong>, tỉ trọng đánh giá cho từng tiêu chí:<br />\r\n&nbsp;+ <u>Sự sáng tạo</u>: 40%<br />\r\n&nbsp;+ <u>Kỹ thuật (công nghệ)</u>: 20%<br />\r\n&nbsp;+ <u>Nghệ thuật (thẩm mỹ)</u>: 20%<br />\r\n&nbsp;+ <u>Tính hoàn thiện</u>: 20%</p>', '<p>- Giải Nhất:&nbsp;1,200,000&nbsp;đồng.<br />\r\n- Giải Nhì:&nbsp;900,000&nbsp;đồng.<br />\r\n- Giải Ba:&nbsp;600,000 đồng.<br />\r\n- Giải Khuyến khích:&nbsp;300.000 đồng.</p>', '<p>- Giải Nhất:&nbsp;1,200,000&nbsp;đồng.<br />\r\n- Giải Nhì:&nbsp;900,000&nbsp;đồng.<br />\r\n- Giải Ba:&nbsp;600,000 đồng.<br />\r\n- Giải Khuyến khích:&nbsp;300.000 đồng.</p>', '<p>- Số lượng sản phẩm dự thi theo cá nhận hoặc nhóm: không hạn chế.<br />\r\n- Sản phẩm dự thi bao gồm:<br />\r\n&nbsp;+ Ảnh sản phẩm (*.jpg hoặc *.pdf).<br />\r\n&nbsp;+ Tài liệu tác phẩm (*.pdf).<br />\r\n&nbsp;+ Thí sinh nộp bài thi trực tiếp vào website: <a href="https://arena.cusc.vn/cuocthiphim_tknv2019.html"><em>https://arena.cusc.vn/cuocthiphim_tknv2019.html</em></a></p>', '<p>Dự thi theo nhóm hoặc cá nhân.</p>', '<p>* Trưởng ban tổ chức: thầy <strong>Nguyễn Hùng Dũng</strong> – Trưởng Bộ môn KTPM&amp;ĐPT</p>', '<p>* Những thầy/cô có nhiều kinh nghiệm trong các lĩnh vực Đa phương tiện:<br />\r\n&nbsp;1. Thầy <strong>Nguyễn Hoàng Việt</strong> – Trưởng ban.<br />\r\n&nbsp;2. Thầy <strong>Nguyễn Trung Kiên</strong> – Thành viên.<br />\r\n&nbsp;3. Thầy <strong>Võ Duy Anh</strong> – Thành viên.</p>', '2019-09-23 00:41:51', '2019-09-23 00:41:51', 1),
	(4, 'Be a Good One', 'Phim ngắn – Be a Good One', 'TheLe_PhimNgan.pdf', NULL, '<p>- Nhằm để tạo sân chơi, tạo môi trường học thuật và nghiên cứu trong sinh viên, hướng dẫn sinh viên sáng tạo các sản phẩm thực tế.<br />\r\n- Tạo môi trường rèn luyện kỹ năng sáng tạo và tạo nền tảng để sinh viên tham dự các cuộc thi khác trong và ngoài nước.<br />\r\n- Nằm trong chuỗi các cuộc thi để xét duyệt trao giải <strong>CUSC’s Creative Cup 2020 </strong>của nhánh Mỹ thuật Đa phương tiện.<br />\r\n- Khuyến khích sự đam mê và yêu thích công việc làm phim trong sinh viên.<br />\r\n- Tiếp cận với quy trình làm phim chuyên nghiệp.</p>', '<p>* Sinh viên đang học tập tại CUSC.</p>', '<p><strong>*Chủ đề: </strong></p>\r\n\r\n<p><strong>&nbsp; “Be a Good One</strong>”.</p>\r\n\r\n<p>&nbsp;- Nội dung sáng tác: đề cao được lối sống và đạo đức tốt của nhân vật trong nhà trường hoặc ngoài xã hội.</p>\r\n\r\n<p>*<strong> Thể loại:</strong></p>\r\n\r\n<p>- Tác phẩm dự thi là một trong các thể loại: phim ngắn, phim kỹ xảo, phim hoạt hình.</p>', '<p>- Số lượng sản phẩm dự thi theo nhóm hoặc cá nhân: không hạn chế.<br />\r\n- Sinh viên phải nộp các nội dung kèm theo hồ sơ dự thi để mô tả về sản phẩm của mình đáp ứng yêu cầu của Ban tổ chức cuộc thi.<br />\r\n- Mỗi nhóm dự thi phải hoàn thành việc báo cáo sản phẩm của nhóm mình. Nếu không sẽ không công nhận kết quả dự thi của nhóm đó.</p>', '<p>- Số lượng sản phẩm dự thi theo nhóm hoặc cá nhân: không hạn chế.<br />\r\n- Sinh viên phải nộp các nội dung kèm theo hồ sơ dự thi để mô tả về sản phẩm của mình đáp ứng yêu cầu của Ban tổ chức cuộc thi.</p>', '<p>- Các sản phẩm là đồ án môn học (project, assignment) hoặc các tác phẩm đã đạt giải trong và ngoài Trung tâm đều không được tham gia dự thi.<br />\r\n- Mỗi sản phẩm dự thi khi nộp cho BTC phải đảm bảo có nội dung lành mạnh, phù hợp thuần phong mỹ tục và phải đảm bảo bản quyền tác giả, không sao chép.<br />\r\n- Sinh viên phải nộp các nội dung kèm theo hồ sơ dự thi để mô tả về sản phẩm của mình đáp ứng yêu cầu của Ban tổ chức cuộc thi.<br />\r\n- Mỗi nhóm dự thi phải hoàn thành việc báo cáo sản phẩm của nhóm mình. Nếu không sẽ không công nhận kết quả dự thi của nhóm đó.<br />\r\n- Trung tâm được quyền sử dụng kết quả của sản phẩm dự thi cho các hoạt động của Trung tâm.</p>', '<p>* Sản phẩm tham gia dự thi được đánh giá, chấm điểm dựa trên 4 tiêu chí: <strong>Kịch bản</strong>, <strong>Kỹ thuật (công nghệ)</strong>, <strong>Nghệ thuật (thẩm mỹ)</strong> và<strong> tính Hoàn thiện</strong>, tỉ trọng đánh giá cho từng tiêu chí:</p>\r\n\r\n<p>+ <u>Kịch bản</u>: 25%<br />\r\n+ <u>Kỹ thuật (công nghệ)</u>: 25%<br />\r\n+ <u>Nghệ thuật (thẩm mỹ)</u>: 25%<br />\r\n+ <u>Tính hoàn thiện</u>: 25%</p>', '<p>- 01 Giải Nhất:&nbsp;1.500.000&nbsp;đồng.</p>\r\n\r\n<p>- 01 Giải Nhì:&nbsp;1.000.000&nbsp;đồng.</p>\r\n\r\n<p>- 01 Giải Ba:&nbsp;800.000 đồng.</p>\r\n\r\n<p>- 02 Giải Khuyến khích:&nbsp;300.000 đồng/giải.</p>', '<p>- 01 Giải Nhất:&nbsp;1.500.000&nbsp;đồng.</p>\r\n\r\n<p>- 01 Giải Nhì:&nbsp;1.000.000&nbsp;đồng.</p>\r\n\r\n<p>- 01 Giải Ba:&nbsp;800.000 đồng.</p>\r\n\r\n<p>- 02 Giải Khuyến khích:&nbsp;300.000 đồng/giải.</p>', '<p>- Số lượng sản phẩm dự thi theo nhóm hoặc cá nhân: không hạn chế.</p>\r\n\r\n<p>- Sản phẩm dự thi bao gồm:<br />\r\n&nbsp;+ Sản phẩm Phim (*.mp4)<br />\r\n&nbsp;+ Tài liệu dự án (*.pdf hoặc *.doc)</p>\r\n\r\n<p>&nbsp;</p>', '<p>* Thí sinh nộp bài thi trực tiếp vào website: <a href="https://arena.cusc.vn/cuocthiphim_tknv2019.html"><em>https://arena.cusc.vn/cuocthiphim_tknv2019.html</em></a></p>', '<p>* Trưởng ban tổ chức: thầy <strong>Nguyễn Hùng Dũng</strong> – Trưởng Bộ môn KTPM&amp;ĐPT.</p>', '<p>* Những thầy/cô có nhiều kinh nghiệm trong các lĩnh vực Đa phương tiện:<br />\r\n&nbsp;1. Thầy <strong>Nguyễn Hoàng Việt</strong> – Trưởng ban.<br />\r\n&nbsp;2. Thầy <strong>Nguyễn Trung Kiên</strong> – Thành viên.<br />\r\n&nbsp;3. Thầy <strong>Võ Duy Anh</strong> – Thành viên.</p>', '2019-09-21 03:30:57', '2019-09-21 03:30:57', 1);
